import { NextPage } from "next";

const sideBarStyle : any = {
    maxWidth: '150px',
    height: '100%'
}

const Sidebar : NextPage = props => (
    <div>
    <div style={sideBarStyle}>
        <p>ee</p>
        <p>aaaaaaaa</p>
    </div>
    <div>
        {props.children}
    </div>
    </div>
);

export default Sidebar;
